    //        {/* <Route path="/rtl" component={RTL} />    */}
    //        <Redirect from="/" to="/store/dashboard" />
    //      </Switch>
    //    </Router>,


    //    document.getElementById("root")
    //  );
    //  }

}
else{

  ReactDOM.render(  


    <Router history={hist}>
       <Switch>   
         <Route path="/key" component={Login} />         
         <Redirect from="/" to="/key/admin-token" />
        </Switch>
       {/* <Route path="/user" component={Login} />        */}
     </Router>,


     document.getElementById("root")

  )

}
